import React from "react";
import { ReactDOM } from "react";
import BodyCategories from "./Categories";

const BodyProducts = () => {
    const categorias = [
        {
            id: 1,
            nome:'Pizza' , 
            produtos:[
                {id: 1, nome:'Broto'},
                {id: 2, nome:'Media'},
                {id: 3, nome:'Grande'},
        ]},
        {
            id: 2,
            nome:'Drinks' , 
            produtos:[
                {id: 1, nome:'Coca-Cola'},
                {id: 2, nome:'Sprite'},
                {id: 3, nome:'Fanta Uva'},
        ]},
    ]

    return (
        <div class='SubProducts'>
            {categorias.map((categoria, index) => {categoria.produtos})}
        </div>
    )
}

export default BodyProducts;
